async function (inputs, outputs, advanced) {
    const { state } = advanced;
    const { response } = outputs;
    const { url, data, options } = inputs;

    const res = await fetch(url, {
      method: "POST",
      body: JSON.stringify(data),
      ...options,
    });

    response.next(res);

    state.set("response", res);
  }
